-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:Vrinda;\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-bidi-language:AR-SA;}\r\n</style>\r\n<![endif]--> <span style=\"font-family:Roboto\">Be ready for the IELTS Exam in 2 months</span></li><li><span style=\"font-family:Roboto\">Learn\r\nfrom UK-qualified, ex-British Council teachers and ex-IELTS examiners</span></li><li><span style=\"font-family:Roboto\">Self-learning\r\noption available</span></li></ul><p class=\"MsoNormal\" style=\"mso-margin-bottom-alt:auto;line-height:normal\"><span style=\"font-family:Roboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\n&quot;Open Sans&quot;;color:#080808\">IELTS Academic is a blended prep course\r\n(online/face-to-face) that brings to you ILC’s teaching expertise at the click\r\nof a mouse. Taught by some of our finest faculty (ex-teachers of British\r\nCouncil and ex-IELTS examiners), IELTS classes are offered on campus as well as\r\nvia Zoom/Google Meet. ILC also has dedicated pure online IELTS packages to\r\ntarget all 4 sections of the test, which you can access from anywhere at\r\nanytime.</span></p><p>\r\n\r\n<br></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;background:white\"><b><span style=\"font-size:12.0pt;font-family:Roboto;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:Arial;color:#163C66\">Live/F2F IELTS classes</span></b><span style=\"font-size:12.0pt;font-family:Roboto;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:Arial;color:#163C66\"><br>\r\nGet the classroom experience from anywhere in Bangladesh</span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;background:white\">\r\n\r\n</p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;background:white\"><b><span style=\"font-size:12.0pt;\r\nfont-family:Roboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nArial;color:#163C66\">Private tutoring</span></b><span style=\"font-size:12.0pt;\r\nfont-family:Roboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nArial;color:#163C66\"><br>\r\nRequest private tutorials to reorient your study plans and get customised exam\r\ntips</span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;background:white\">\r\n\r\n</p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;background:white\"><b><span style=\"font-size:12.0pt;\r\nfont-family:Roboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nArial;color:#163C66\">Guided self-learning</span></b><span style=\"font-size:\r\n12.0pt;font-family:Roboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nArial;color:#163C66\"><br>\r\nPrepare the exam at your own pace with the support of your teacher, or by\r\nyourself</span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;background:white\">\r\n\r\n</p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;background:white\"><b><span style=\"font-size:12.0pt;\r\nfont-family:Roboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nArial;color:#163C66\">Group work</span></b><span style=\"font-size:12.0pt;\r\nfont-family:Roboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\nArial;color:#163C66\"><br>\r\nInteract with like-minded students and practice for the IELTS exam</span></p>', 1, '60', 1, '2021-02-08 10:30:26', '2021-02-24 00:44:37', NULL, 1);
INSERT INTO `edu_courses` (`id`, `course_name`, `course_thumb`, `course_overview`, `paid_status`, `duration`, `created_by`, `created_at`, `updated_at`, `deleted_at`, `valid`) VALUES
(2, 'Prepare for IELTS General', '1613619167.jpeg', '<ul><li>Be ready for the IELTS Exam in 2 months</li><li>Learn from UK-qualified, ex-British Council teachers and ex-IELTS examiners</li><li>Self-learning option available</li></ul><p>IELTS Academic is a blended prep course (online/face-to-face) that brings to you ILC’s teaching expertise at the click of a mouse. Taught by some of our finest faculty (ex-teachers of British Council and ex-IELTS examiners), IELTS classes are offered on campus as well as via Zoom/Google Meet. ILC also has dedicated pure online IELTS packages to target all 4 sections of the test, which you can access from anywhere at any time.</p><p><br></p><p align=\"left\"><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:RelyOnVML></o:RelyOnVML>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>BN-BD</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapToGridInCell>\r\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\r\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\r\n   <w:DontGrowAutofit></w:DontGrowAutofit>\r\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\r\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning>\r\n   <w:DontFlipMirrorIndents></w:DontFlipMirrorIndents>\r\n   <w:Overri