INSERT INTO `edu_courses` (`id`, `course_name`, `course_thumb`, `course_overview`, `paid_status`, `duration`, `created_by`, `created_at`, `updated_at`, `deleted_at`, `valid`) VALUES
(3, 'English Skills', '1613619137.jpeg', '<p><b>Start Speaking Better English Today!</b></p><p>Do you need to improve your speaking skills?</p><ul><li>Start instantly and develop your English fluency at your own schedule</li><li>Cambridge qualified teachers</li><li>Ex-British Council teachers</li><li>Structured Online and Face-to-face Courses</li><li>Learning materials &amp; practice activities</li></ul>', 1, '60', 1, '2021-02-08 12:49:49', '2021-02-17 21:32:17', NULL, 1),
(4, 'Cambridge English', '1613619117.jpeg', '<p><b>Prepare your child for the Cambridge English examinations</b></p><p>Maximize your child’s progress with the globally recognized examinations <b>Cambridge English: A1 Starters, A1 Movers, A2 Flyers, A2 Key for Schools and B1 Preliminary for Schools.</b></p><p><b>Courses available are:</b></p><ul><li>Pre-A1 Starters</li><li>A1 Movers (P1 to P3)</li><li>A2 Flyers (P3 to P6)</li><li>A2 Key for Schools (P5 to P6)</li><li>B1 Preliminary for Schools (P5 to P6)</li><li>B2 First for Schools.</li></ul>', 1, '183', 1, '2021-02-08 13:10:10', '2021-02-17 21:31:57', NULL, 1),
(5, 'IGCSE & A Level English', '1613619075.jpeg', '<p align=\"center\"><img src=\"data:image/png;base64,\" data-filename=\"cse5.png\" style=\"width: 25%;\">&nbsp;<img src=\"data:image/png;base64,\" data-filename=\"cse6.png\" style=\"width: 25%;\"></p><p class=\"MsoNormal\" style=\"mso-margin-bottom-alt:auto;line-height:normal\"><img src=\"data:image/png;base64,\" data-filename=\"cse1.png\" style=\"width: 55px;\"><b><span style=\"font-size:12.0pt;font-family:&quot;Segoe UI&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#6D6D6D\">Start anytime </span>: </b><span style=\"font-size:12.0pt;font-family:&quot;Segoe UI&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#6D6D6D\">Support till summer 2022 results</span></p><p class=\"MsoNormal\" style=\"mso-margin-bottom-alt:auto;line-height:normal\"><img src=\"data:image/png;base64,\" data-filename=\"cse2.png\" style=\"width: 55px;\"><b><span style=\"font-size:12.0pt;font-family:&quot;Segoe UI&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#6D6D6D\">Exams </span>: </b><span style=\"font-size:12.0pt;font-family:&quot;Segoe UI&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#6D6D6D\">May/June 2021, January 2022, May/June 2022</span></p><p class=\"MsoNormal\" style=\"mso-margin-bottom-alt:auto;line-height:normal\"><img src=\"data:image/png;base64,\" data-filename=\"cse3.png\" style=\"width: 55px;\"><b><span style=\"font-size:12.0pt;font-family:&quot;Segoe UI&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#6D6D6D\">Online &amp; Face-2-face</span> </b><span style=\"font-size:12.0pt;font-family:&quot;Segoe UI&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#6D6D6D\">with unlimited 1:1 tutor support</span></p><p class=\"MsoNormal\" style=\"mso-margin-bottom-alt:auto;line-height:normal\"><img src=\"data:image/png;base64,\" data-filename=\"cse4.png\" style=\"width: 55px;\"><b><span style=\"font-size:12.0pt;font-family:&quot;Segoe UI&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#6D6D6D\">Additional fees <o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"mso-margin-bottom-alt:auto;line-height:normal\">\r\n\r\n</p><p class=\"MsoNormal\" style=\"mso-margin-bottom-alt:auto;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Segoe UI&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#6D6D6D\">Exam center fees</span></p><p class=\"MsoNormal\" style=\"mso-margin-bottom-alt:auto;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Segoe UI&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#6D6D6D\"><o:p></o:p></span></p><ul><li style=\"line-height: normal;\"><font face=\"Segoe UI, sans-serif\" color=\"#6d6d6d\"><span style=\"font-size: 16px;\">Study English with our highly experienced, ex-British Council and ex-Aga Khan teachers</span></font></li><li style=\"line-height: normal;\"><font face=\"Segoe UI, sans-serif\" color=\"#6d6d6d\"><span style=\"font-size: 16px;\">Live online classrooms&nbsp;</span></font></li><li style=\"line-height: normal;\"><font face=\"Segoe UI, sans-serif\" color=\"#6d6d6d\"><span style=\"font-size: 16px;\">Large, spacious and sanitized classrooms enabling social distancing</span></font></li><li style=\"line-height: normal;\"><font face=\"Segoe UI, sans-serif\" color=\"#6d6d6d\"><span style=\"font-size: 16px;\">Unlimited 1:1 personal tutor support</span></font></li><li style=\"line-height: normal;\"><font face=\"Segoe UI, sans-serif\" color=\"#6d6d6d\"><span style=\"font-size: 16px;\">Learn at your own pace and set your own schedule</span></font></li></ul>', 1, '455', 1, '2021-02-08 13:28:40', '2021-02-24 00:22:32', NULL, 1);

