INSERT INTO `edu_student_reviews` (`id`, `student_name`, `review`, `status`, `created_by`, `created_at`, `updated_at`, `deleted_at`, `valid`) VALUES
(1, 'Rafikul Islam Rafi', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.', 0, 1, '2020-11-10 13:54:10', '2021-02-17 22:21:48', NULL, 1),
(2, 'Najmul Hasan Sobuj', 'In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content.', 1, 1, '2020-11-10 13:55:11', '2021-02-17 22:23:37', NULL, 1),
(3, 'Ashikul Islam', 'Hello This is Ashikul Islam. I\'m a civil engineer but it\'s not my profession. Amazingly I\'m a Graphic Designer . I\'m working in this profession for 5 long years and earning my bread and butter from this by freelancing. Yes designing is in my blood and I love create something new with my imagination. You know something, Do what you love Love what you do. Stay strong stay Blessed. Ashikul Islam Not a Civil Engineer Proudly a Graphic Designer.', 1, 1, '2020-11-15 01:18:12', '2021-02-17 22:23:20', NULL, 1);

